    "Cons": "Terrible employment conditions under the company i'm contracted with. No penalties for shift work (finish alternate weeks at 2330 hrs with over time if it happens until 0230 hrs, or commencement at 0430 hrs), no sick leave, no annual leave, no over time penalty rates, no staff travel, The company is very slow at organising and setting up maintenance access which is a critical component of the role. Uncomfortable supervisor to staff relationships. The fact that you can have some of the staff that do the exact same job but under another employment contract with the Qantas brand receive every employment condition and benefit, definitely not good for team harmony. Over the time i have been employed, a lot of staff have been fired or retrenched which is not good for morale. Very little validation on tasks that take a lot of time and effort to complete to an exceptional standard. Apprentices that complete their 4 years are only put on for a further 18 month fixed term contract.",
