    "Diversity": 5,
    "Cons": "A lot of networks and company wisdom is informal. You need to be sponsored and connected to get things done. Sometimes it seems as if a lot more effort goes towards Selling your achievements than actually accomplishing them. There is still a strong herd mentality resulting in a fear of bold or unconventional action. Genuine leadership is rare, like diamonds in the rough. Pay is currently above average for the industry though there is concerted effort to bring it in line.  Work-life balance depends on your ambition and bargaining power. There is no work from home policy. Travel benefits are not as generous as others. You are probably better off buying commercial tickets or using your own frequent flier points. Diversity is actively encouraged during recruitment to hasten the transformation of the workforce. Good news but more needs to be done.  Beyond your immediate role, Training, mentoring and career development is squarely a personal responsibility.",
    "Pros": "Majority of staff are passionate about delivering great service. Diversity is valued with a caveat that at the end of the day, perceptions still matter. Surprisingly nimble in decision making and executing strategies for a large organisation with combination matrix and hierarchical structure.  Clubby and in some areas a family 'everyone knows everyone' culture. You can get well connected by asking for assignments and proving you can deliver. Honest mistakes are tolerated and you must persevere until you get the job done. High achievers are rewarded. A lot of work being done to foster a startup and innovation mentality at the grassroots level.  Plenty of career choices if you're based in Sydney.  The Head Office is a cocooned oasis. Management style is mostly fair and adapts to your level of competence.  Most genuinely care about your performance and make professional enough effort to overcome personal biases.  Senior executives can be openly questioned during regular town hall meetings.",
